import { Component, OnInit } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'app-findings',
  templateUrl: './findings.component.html',
  styleUrls: ['./findings.component.css']
})
export class FindingsComponent {
  searchQuery: string = '';
  results: any[] = [];
  errorMessage: string = '';

  constructor(private http: HttpClient) {}

  onSearch() {
    if (!this.searchQuery.trim()) {
      this.errorMessage = 'Blank search';
      this.results = [];
      return;
    }

    this.http.get<any[]>(`http://localhost:3000/api/search?q=${this.searchQuery}`).subscribe(
      data => {
        this.results = data;
        if (this.results.length === 0) {
          this.errorMessage = 'Data not present';
        } else {
          this.errorMessage = '';
        }
      },
      error => {
        this.errorMessage = 'Error performing search';
        this.results = [];
      }
    );
  }
}
<div class="container">
    <h2>Search</h2>
    <input type="text" [(ngModel)]="searchQuery" placeholder="Enter your search term..." (keyup.enter)="onSearch()">
    <button (click)="onSearch()">Search</button>
    <ul *ngIf="results.length > 0">
        <li *ngFor="let item of results">
            <!-- Display for beyond category -->
            <div *ngIf="item.title">
                <strong>Title:</strong> {{ item.title }} 
                <strong>Author:</strong> {{ item.author }}
                <strong>Post:</strong> {{ item.post }}
            </div>

            <!-- Display for deities category -->
            <div *ngIf="item.pantheon">
                <strong>Name:</strong> {{ item.name }}
                <strong>Pantheon:</strong> {{ item.pantheon }}
                <strong>Attributes:</strong> {{ item.attributes }}
                <strong>Mythology:</strong> {{ item.mythology }}
                <strong>Symbols:</strong> {{ item.symbols }}
            </div>

            <!-- Display for potions and spells category -->
            <div *ngIf="item.purpose">
                <strong>Name:</strong> {{ item.name }}
                <strong>Purpose:</strong> {{ item.purpose }}
                <strong>Materials:</strong> {{ item.materials }}
            </div>
        </li>
    </ul>
    <div *ngIf="errorMessage">{{ errorMessage }}</div>
</div>
